import React from 'react';
import styled from 'styled-components';

const StyledList = styled.ul`
  display: flex;
  justify-content: center;
  li {
    width: 32%;
    display: inline-block;
    list-style: none;

    & + & {
    }
  }
  img {
  }
`;

const Lists = ({ children }) => {
  return (
    <div>
      <StyledList>{children}</StyledList>
    </div>
  );
};

export default Lists;
